def flip_string(str):
    return ''.join(['+' if c == '-' else '-' for c in str])

def flip_portion(str, start, end):
    beginning = str[:start]
    middle = str[start:end]
    ending = str[end:]
    return beginning + flip_string(middle) + ending

def flip_first_plus(state, flipper_size):
    for i in range(len(state) - flipper_size + 1):
        if state[i] == '-':
            return flip_portion(state, i, i + flipper_size)

def is_solved(str):
    return '-' not in str

def count_portion(str, start, end):
    count = 0

    for i in str[start:end]:
        if i == '-':
            count += 1

    return count

